<script>
import { useScroll, useMediaQuery } from "@vueuse/core";
import { computed } from "@vue/composition-api";
import CustomLink from "./custom-link.vue";
import HamburgerBtn from "./btn-hamburger.vue";
export default {
  name: "LayoutNavbar",
  props: {
    menu: {
      type: Array
    },
    socials: Array,
    clutchLink: String
  },
  components: { CustomLink, HamburgerBtn },
  data() {
    return {
      isTransparent: true,
      mobileExpanded: false,
      popUpData: null,
      popUpActive: false,
      popUpHover: false,
      hoverItem: "",
      pointerPosition: 0,
      showSection: false,
      windowY: 0
    };
  },
  setup() {
    const scroll = useScroll(globalThis.window);
    let show = true;
    let isVisible = computed(() => {
      if (scroll.directions.top || scroll.y.value < 40) {
        show = true;
      } else if (scroll.directions.bottom) {
        show = false;
      }
      return show;
    });

    let showSection;
    showSection = false;
    let showAbout = computed(() => {
      if (scroll.y.value > 500 && scroll.y.value < 1000) {
        showSection = true;
        return (showSection = true);
      }
    });
    let showExplore = computed(() => {
      if (scroll.y.value > 1100 && scroll.y.value < 2000) {
        return (showSection = true);
      }
    });
    let showSpeakers = computed(() => {
      if (scroll.y.value > 3700 && scroll.y.value < 4600) {
        return (showSection = true);
      }
    });
    let showAgenda = computed(() => {
      if (scroll.y.value > 4600 && scroll.y.value < 6300) {
        return (showSection = true);
      }
    });

    let underTreshold = computed(() => scroll.y.value < 170);
    const isLargeScreen = useMediaQuery("(min-width: 1248px)");

    return {
      isLargeScreen: isLargeScreen,
      isVisible: isVisible,
      underTreshold: underTreshold,
      scrollPositionY: scroll.y,
      showAbout: showAbout,
      showExplore: showExplore,
      showSpeakers: showSpeakers,
      showAgenda: showAgenda
    };
  },

  mounted() {
    if (globalThis.window.scrollY < 300) {
      this.isTransparent = true;
    } else {
      this.isTransparent = false;
    }
  },
  watch: {
    isLargeScreen(value) {
      if (value) {
        this.mobileExpanded = false;
        // console.log(globalThis.window.scrollY);
      }
    },

    underTreshold(value) {
      this.isTransparent = value;
    }
  },
  methods: {
    scrollToTop() {
      window.scrollTo({
        top: 0,
        behavior: "smooth"
      });
    },
    toggleMobile() {
      this.mobileExpanded = !this.mobileExpanded;
    },
    scrollToSection(section) {
      if (section === "about") {
        this.scrollToY(700);
      } else if (section === "explore") {
        this.scrollToY(1300);
      } else if (section === "speakers") {
        this.scrollToY(3900);
      } else if (section === "agenda") {
        this.scrollToY(5100);
      }
    },
    scrollToY(y) {
      window.scrollTo({
        top: y,
        behavior: "smooth"
      });
    }
  }
};
</script>

